import auth from '../../server/middleware/auth';
import connectDB from '../../server/config/db';
import cookie from 'cookie';

export default async (req, res) => {
  await connectDB();

  res.clearCookie('auth');

  console.log(req.headers);
  console.log(req.cookies);
  res.json('heee');
  // if (method === 'POST') {

  // }
};
